@Dark Clouds China should have stopped building HSR in 2010, instead as always without proper leadership, it kept building and building and building.  Most of China's HSR lines do not even generate enough revenue to cover operating costs(electricity, maintenance, worker salaries), let alone cover the borrowing cost.

What could China have spent $1 trillion on?  Maybe water filtration so the water would be drinkable?  Maybe improving health care?  

The total estimated cost to finish California's HSR is $100 Billion, not total spent do date.  Pull your little pink head of our your arse.
